import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Button,
  Row,
  Container,
  Col,
} from "reactstrap";
import "../App.css";
import Header from "../header/header";
import Footer from "../footer";
import EventMap from "../mapping/eventhome";




class Profile extends Component {
  render(props) {
    return (
      <div className="App">
        <Header />
        <Container>
          <br></br>
          <br></br>
          <br></br>
          <br></br>
          <h1
            style={{ textAlign: "left", color: "#FF5555", fontWeight: "700" }}
          >
            Profile
          </h1>
          <Row>
            <Col sm={6} className="profile">
              <h1 style={{ textAlign: "left" }}>{props.name}</h1>
              <h3> 13-10-1990</h3>
              <h3>{props.tel}</h3>
              <h3>{props.email}</h3>
            </Col>
            <Col sm={2}>
              <Button size="sm">Edit Profile</Button>
            </Col>
            <Col sm={4}>
              <img
                src={`${props.img}`}
                width="100%"
                height="300px"
              />
            </Col>
          </Row>
          <br></br>
          <br></br>
          <h1 style={{ textAlign: "left", color: "#FF5555", fontWeight: "700" }}>Favorites</h1>
          <br></br>
          <br></br>
          <EventMap />
        </Container>
        <Footer />
      </div>
    );
  }
}

export default Profile;
